class Solution(object):
    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(i, curr, prev, op, res):
            if i == len(num):
                if curr == target and op == "":
                    res.append(num)
                return
            for j in range(i, len(num)):
                if j > i and num[i] == "0":
                    break
                curr = int(num[i:j+1])
                if op == "":
                    backtrack(j+1, curr, curr, num[i], res)
                else:
                    backtrack(j+1, curr, int(eval(str(prev)+op+num[j+1])), num[j+1], res)

        res = []
        backtrack(0, 0, 0, "", res)
        return res

