    def search(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: int
        """

        # find the pivot
        pivot = self.find_pivot(nums)

        # if the target is in the first half of the array, search in the first half
        if nums[pivot] <= target <= nums[-1]:
            return self.binary_search(nums, target, 0, pivot)

        # if the target is in the second half of the array, search in the second half
        else:
            return self.binary_search(nums, target, pivot, len(nums) - 1)

    def find_pivot(self, nums):
        left, right = 0, len(nums) - 1

        while left < right:
            mid = (left + right) // 2

            if nums[mid] > nums[right]:
                left = mid + 1
            else:
                right = mid

        return left

    def binary_search(self, nums, target, left, right):
        while left <= right:
            mid = (left + right) // 2

            if nums[mid] == target:
                return mid
            elif nums[mid] < target:
                left = mid + 1
            else:
                right = mid - 1

        return -1

