        """
        :type nums: List[int]
        :type target: int
        :rtype: bool
        """

        # find the pivot
        pivot = self.find_pivot(nums)

        # if the target is in the first half of the array, search in the first half
        if nums[pivot] == target:
            return True

        # if the target is in the second half of the array, search in the second half
        if nums[len(nums)-1] == target:
            return True

        # if the target is not in the first half of the array, search in the second half
        if nums[pivot] < target:
            return self.binary_search(nums[pivot:], target)

        # if the target is not in the second half of the array, search in the first half
        return self.binary_search(nums[:pivot], target)

    def find_pivot(self, nums):
        left = 0
        right = len(nums) - 1

        while left < right:
            mid = (left + right) // 2

            if nums[mid] > nums[right]:
                left = mid + 1
            else:
                right = mid

        return left

    def binary_search(self, nums, target):
        left = 0
        right = len(nums) - 1

        while left <= right:
            mid = (left + right) // 2

            if nums[mid] == target:
                return True
            elif nums[mid] < target:
                left = mid + 1
            else:
                right = mid - 1

        return False

